  // };

  const onNextPage = () => {
    getData();
    setStart(start+20)
		history.push(`/search?q=${searchText}&start=${start+20}`);
		window.scrollTo(0, 0)
	}
  console.log(start)
  if (start == 0) {
    return (
      <div>
        <button onClick={onNextPage}>Next</button>
      </div>
    );
  }


}
